import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../../images/landing.svg';


function Home() {
    return(
        <div class="content">
            <div class="container">
                <header>Bem vindoa o hweader

                </header>
                <main>
                    <Link to="/produtos">
                        <img src={Logo} alt="" > teste</img>
                    </Link>
                </main>
            </div>
        </div>
    )
}

export default Home;
